Given that \( n \equiv 2 \pmod{7} \), we need to find the value of the expression \((n + 2)(n + 4)(n + 6) \pmod{7}\).

First, substitute \( n = 7k + 2 \) for some integer \( k \) into the expression:
\[
(n + 2)(n + 4)(n + 6) = (7k + 2 + 2)(7k + 2 + 4)(7k + 2 + 6) = (7k + 4)(7k + 6)(7k + 8).
\]
Next, we reduce each term modulo 7:
\[
7k + 4 \equiv 4 \pmod{7}, \quad 7k + 6 \equiv 6 \pmod{7}, \quad 7k + 8 \equiv 1 \pmod{7}.
\]
Thus, the expression simplifies to:
\[
(7k + 4)(7k + 6)(7k + 8) \equiv 4 \cdot 6 \cdot 1 \pmod{7}.
\]
 Now, we calculate the product \( 4 \cdot 6 \cdot 1 \):
\[
4 \cdot 6 = 24.
\]
Next, we reduce 24 modulo 7:
\[
24 \equiv 3 \pmod{7}.
\]
Therefore, the value of the expression \((n + 2)(n + 4)(n + 6) \pmod{7}\) is \(\boxed{3}\).```
The final answer is \(\boxed{3}\).```


